import React from 'react';
import './assets/css/base/base.css';
import Sobre from './paginas/Sobre';
import Home from './paginas/Home';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
function App() {
  return (
    <Router>
      <Route exact path='/'>
        <Home />
      </Route>
      <Route path='/sobre'>
        <Sobre />
      </Route>
    </Router>
  );
}

export default App;
